import React from 'react'
import { NavLink } from 'react-router-dom'
const Navbar = () => {
  return (
    <>
      <NavLink to='/'        exact activeClassName='nav' className='p'>Home</NavLink>
      <NavLink to='/about'   exact activeClassName='nav'>About</NavLink>
      <NavLink to='/service' exact activeClassName='nav'>Service</NavLink>
      <NavLink to='/contact' exact activeClassName='nav'>Contact</NavLink>

    </>
  )
}

export default Navbar
